api = idb.IDAPython(kernel32_idb)
DllEntryPoint = api.ida_funcs.get_func(1754273429)
bbs = list(api.idaapi.FlowChart(DllEntryPoint))
assert list(sorted(lpluck('startEA', bbs))) == [1754273429, 1754273444, 
    1754292566]
for bb in bbs:
    if bb.startEA == 1754273429:
        assert list(sorted(lpluck('startEA', bb.succs()))) == [1754273444, 
            1754292566]
    elif bb.startEA == 1754273444:
        assert lpluck('startEA', bb.succs()) == []
    elif bb.startEA == 1754292566:
        assert lpluck('startEA', bb.succs()) == [1754273444]
for bb in bbs:
    if bb.startEA == 1754273429:
        assert lpluck('startEA', bb.preds()) == []
    elif bb.startEA == 1754273444:
        assert list(sorted(lpluck('startEA', bb.preds()))) == [1754273429, 
            1754292566]
    elif bb.startEA == 1754292566:
        assert lpluck('startEA', bb.preds()) == [1754273429]
kern32_test()
